import React from "react";

function Menu() {
    return (
        <div className="menu">
            <div class = "servicestitleleft">
                MENU
    </div>
            <div>
                <div class = "topcards">
                    <div class="card">
                        <img class="imgcard" src="./images/flat-lay-photography-of-pasta-served-in-white-plate-1487511.jpg" alt="Avatar" />
                        <div class="container">
                            {/* <h4><b>John Doe</b></h4> */}
                            {/* <p>Architect & Engineer</p> */}
                        </div>
                    </div>
                    <div class="card">
                        <img class="imgcard" src="./images/bread-with-soup-2474661.jpg" alt="Avatar" />
                        <div class="container">
                            {/* <h4><b>John Doe</b></h4> */}
                            {/* <p>Architect & Engineer</p> */}
                        </div>
                    </div>
                    <div class="card">
                        <img class="imgcard" src="./images/appetizer-bowl-chili-close-up-286283.jpg" alt="Avatar" />
                        <div class="container">
                            {/* <h4><b>John Doe</b></h4> */}
                            {/* <p>Architect & Engineer</p> */}
                        </div>
                    </div>
                    
                </div>
                <div class = "bottomcards">
                <div class="card">
                        <img class="imgcard" src="./images/club-sandwich-served-on-chopping-board-1600711.jpg" alt="Avatar" />
                        <div class="container">
                            {/* <h4><b>John Doe</b></h4> */}
                            {/* <p>Architect & Engineer</p> */}
                        </div>
                    </div>
                    <div class="card">
                        <img class="imgcard" src="./images/hamburger-beside-fries-2271107.jpg" alt="Avatar" />
                        <div class="container">
                            {/* <h4><b>John Doe</b></h4> */}
                            {/* <p>Architect & Engineer</p> */}
                        </div>
                    </div>
                    <div class="card">
                        <img class="imgcard" src="./images/taylor-kiser-POFG828-GQc-unsplash.jpg" alt="Avatar" />
                        <div class="container">
                            {/* <h4><b>John Doe</b></h4> */}
                            {/* <p>Architect & Engineer</p> */}
                        </div>
                    </div>
                </div>
            </div>

        </div>
    );
}

export default Menu;
